import { SvgIcon } from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';

const StatusIcon = withStyles({
  root: {
    fontSize: '5em',
    color: 'green'
  }
})(SvgIcon);

export default StatusIcon;
